'''''-më''''' is a [[Quenya]] suffix which usually denotes abstract, or at least rather intangible, things.<ref>{{PE|Eldarin}}, p. 68</ref>
==Examples==
*''[[Isilmë#Etymology|Isil'''më''']]'' = "moonlight"{{fact}}
*''[[melmë|mel'''më''']]'' = "love" ("to love"; [[MEL]]){{fact}}
*''[[nilmë|nil'''më''']]'' = "friendship" ("friend"; [[NIL]]){{fact}}
*''tel'''më''''' = "cover" ("hood"; [[TEL]]){{fact}}
*''qual'''më''''' = "agony, death" ("to die in pain"; [[KWAL]]){{fact}}
